接口 interface - 只声明成员方法，不做实现

  TypeScript的核心原则之一是对值所具有的结构进行类型检查。 它有时被称做“鸭式辨型法”或“结构性子类型化”。 在TypeScript里，接口的作用就是为这些类型命名和为你的代码或第三方代码定义契约。

初识

类型检查器会查看fn的调用，参数要求必需一个为string类型的label。
只检查必需属性是否存在，并且类型是否匹配。类型检查器不会检查属性顺序

    let fn = (params: { label:string } ) => {
        console.log(params.label);
    }

    interface paramsLimit {
        label:string,
    }
    // paramsLimit 接口相当于名字，描述要求。
    fn = (params:paramsLimit) => {
        console.log(params.label);
    }

可选属性

接口属性不全是必需

    interface paramsLimit {
        label?:string;
        title?:string;
    }
    let fn = (parasm:paramsList):{} => {
        console.log(params);
    }
    fn(); // success
    fn({ label:'2' }); // success
    fn({ label:'2', title:'1' }); // success

只读属性 readonly

对象属性只能在对象创建时修改值

    interface ReadOnly {
        readonly title:string;
        readonly num:number;
    }
    let readonlyObject:ReadOnly = {
        title:'title',
        num:3,
    }
    readonlyObject.title = 'title2'; // error


typeScript 具有 ReadonlyArray 类型，与 Array 相似,只是把所有可变的方法去掉了

    let a:number[] = [1,2,4];
    let ro:ReadonlyArray = a;
    ro[0] = 1; // error
    ro.push(2); // error
    let b = ro; // success 可使用断言
    a = ro; // error
    a = ro as number[]; // success
    a = ro; // success JSX中不可使用

额外的属性检查

SquareConfig 可以有任意数量的属性

    interface SquareConfig {
        label?:string;
        title?:string;
        [propname:string]:any
    }
    let fn:void = (data:SquareConfig) => {}
    fn({color:2}) // success;


赋值给其他变量

    let a = {colo:2,title:2}
    fn(a); // success a不需经过额外属性检查 和SquareConfig有相同属性时可用;
    let b = {colo:3}
    fn(b); // error

函数类型

定义调用签名：定义参数列表和返回值类型的函数定义

   interface SearchFn {
        ( source:string, title:string ): number;
   }
   let fn:SearchFn = (source:string,title:string) => true
   // 函数的参数会逐个进行检查，要求对应位置上的参数类型是兼容的。
   fn = ({a:string,b:string}):boolean{} // error boolean不符合number

可索引的类型

可索引类型需具有一个索引签名，它描述了对象索引的类型，还有相应的索引返回值类型

   interface StringArray {
        [ index:number ]:string;
   }
   let a:StringArray = ['1','2','3'];
   a[1]; // '2'

类类型
实现接口

接口描述了类的公共部分，而不是公共和私有两部分。它不会帮你检查类是否具有某些私有成员
interface ClockInterface {
    currentTime: Date;
    setTime(d: Date): void;
}

class Clock implements ClockInterface { // implements 实现的意思
    currentTime: Date = new Date();
    setTime(d: Date) {
        this.currentTime = d;
    }
    constructor(h: number, m: number) { }
}



类静态部分和实例部分的区别

类具有两个类型：静态部分的类型和实例的类型

继承接口

和类一样，接口也可以相互继承。
// 继承单个接口
interface Shape {
    color: string;
}

interface Square extends Shape {
    sideLength: number;
}

let square = {};
square.color = "blue";
square.sideLength = 10;

// 继承多个接口
interface Shape {
    color: string;
}

interface PenStroke {
    penWidth: number;
}

interface Square extends Shape, PenStroke {
    sideLength: number;
}

let square = {};
square.color = "blue";
square.sideLength = 10;
square.penWidth = 5.0;



混合类型

先前我们提过，接口能够描述JavaScript里丰富的类型。 因为JavaScript其动态灵活的特点，有时你会希望一个对象可以同时具有上面提到的多种类型。
一个例子就是，一个对象可以同时做为函数和对象使用，并带有额外的属性。
 interface Counter {
     (start: number): string;
     interval: number;
     reset(): void;
 }

 function getCounter(): Counter {
     let counter = function (start: number): string { return '' };
     counter.interval = 123;
     counter.reset = function () { };
     return counter;
 }

 let c = getCounter();
 c(10);
 c.reset();
 c.interval = 5.0;



接口继承类

当接口继承了一个类类型时，它会继承类的成员但不包括其实现。 就好像接口声明了所有类中存在的成员，但并没有提供具体实现一样。 接口同样会继承到类的private和protected成员。 这意味着当你创建了一个接口继承了一个拥有私有或受保护的成员的类时，这个接口类型只能被这个类或其子类所实现（implement）。
class Control {
    private state: any;
}

interface SelectableControl extends Control {
    select(): void;
}

class Button extends Control implements SelectableControl {
    select() { }
}

class TextBox extends Control {
    select() { }
}

// Error: Property 'state' is missing in type 'Image'.
class Image implements SelectableControl {
    select() { }
}

class Location {

}



  在上面的例子里，SelectableControl包含了Control的所有成员，包括私有成员state。 因为state是私有成员，所以只能够是Control的子类们才能实现SelectableControl接口。 因为只有Control的子类才能够拥有一个声明于Control的私有成员state，这对私有成员的兼容性是必需的。
  在Control类内部，是允许通过SelectableControl的实例来访问私有成员state的。 实际上，SelectableControl就像Control一样，并拥有一个select方法。 Button和TextBox类是SelectableControl的子类（因为它们都继承自Control并有select方法），但Image和Location类并不是这样的。

TypeScript/class.html.body:
类 -类实现并实现方法

  传统的JavaScript程序使用函数和基于原型的继承来创建可重用的组件，但对于熟悉使用面向对象方式的程序员来讲就有些棘手，因为他们用的是基于类的继承并且对象是由类构建出来的。 从ECMAScript 2015，也就是ECMAScript 6开始，JavaScript程序员将能够使用基于类的面向对象的方式。 使用TypeScript，我们允许开发者现在就使用这些特性，并且编译后的JavaScript可以在所有主流浏览器和平台上运行，而不需要等到下个JavaScript版本。
  两部分：静态部分和实例部分。

共有，私有与受保护的修饰符
默认为 public
    class Animal {
        public name:string;
        public move(distance:number){
            console.log(`move ${distance}`);
        }
    }

私有 private

当成员被标记为private时，它就不能在声明它的类外部访问。class Animal {
    private name:string;
    constructor(thename:number){
        this.name = thename;
    }
}
new Animal('Cat').name // error  name是私有的


类型兼容：如果其中一个类型里包含一个private成员，那么只有当另一个类型中也存在这样一个private成员，并且它们都是来自同一处声明时，我们才认为这两个类型是兼容的。protected也适用这个规则。
class Animal {
    private name: string;
    constructor(theName: string) { this.name = theName; }
}

class Rhino extends Animal {
    constructor() { super("Rhino"); }
}

class Employee {
    private name: string;
    constructor(theName: string) { this.name = theName; }
}

let animal = new Animal("Goat");
let rhino = new Rhino();
let employee = new Employee("Bob");

animal = rhino;
animal = employee; // 错误: Animal 与 Employee 不兼容.



被保护 protected

  与private修饰符的行为相似，但protected成员在派生类中仍然可以访问

    class Person {
        protected name: string;
        constructor(name: string) { this.name = name; }
    }

    class Employee extends Person {
        private department: string;

        constructor(name: string, department: string) {
            super(name); // protected属性name在派生类中还可使用
            this.department = department;
        }

        public getElevatorPitch() {
            return `Hello, my name is ${this.name} and I work in ${this.department}.`;
        }
    }

    let howard = new Employee("Howard", "Sales");
    console.log(howard.getElevatorPitch());
    console.log(howard.name); // 错误

    class Person {
        protected name: string;
        protected constructor(theName: string) { this.name = theName; } // 不能被实力话，但是可以继承
    }

    // Employee 能够继承 Person
    class Employee extends Person {
        private department: string;

        constructor(name: string, department: string) {
            super(name);
            this.department = department;
        }

        public getElevatorPitch() {
            return `Hello, my name is ${this.name} and I work in ${this.department}.`;
        }
    }

    let howard = new Employee("Howard", "Sales");
    let john = new Person("John"); // 错误: 'Person' 的构造函数是被保护的.

readonly 修饰符

将属性设置为只读，只读属性必须在声明时或构造函数里被初始化。class Octopus {
    readonly name: string;
    readonly numberOfLegs: number = 8;
    constructor (theName: string) {
        this.name = theName;
    }
}
let dad = new Octopus("Man with the 8 strong legs");
dad.name = "Man with the 3-piece suit"; // 错误! name 是只读的.



参数属性

参数属性通过给构造函数添加一个访问限定符来声明。使用private限定一个参数属性会声明并初始化一个私有成员；对于public和protected来说是一样的。class Animal {
    constructor(private name: string) { }
    move(distanceInMeters: number) {
        console.log(`${this.name} moved ${distanceInMeters}m.`);
    }
}



存取器

typeScript 支持通过 getter/setter 来截取对对象成员的访问。
注意：只带有 get ，不带有 set 的存取器自动被推断为 readonly。

    class Employee {
        private _fullName: string;

        get fullName(): string {
            return this._fullName;
        }

        set fullName(newName: string) {
            this._fullName = newName;
        }
    }

    let employee = new Employee();
    employee.fullName = "Bob Smith";
    if (employee.fullName) {
        alert(employee.fullName);
    }

静态属性

存在于类本身上面而不是类的实例上，每个实例想要访问，都需使用类名访问。
class Grid {
    static origin = {x: 0, y: 0};
    calculateDistanceFromOrigin(point: {x: number; y: number;}) {
        let xDist = (point.x - Grid.origin.x);
        let yDist = (point.y - Grid.origin.y);
        return Math.sqrt(xDist * xDist + yDist * yDist) / this.scale;
    }
    constructor (public scale: number) { }
}

let grid1 = new Grid(1.0);  // 1x scale
let grid2 = new Grid(5.0);  // 5x scale

console.log(grid1.calculateDistanceFromOrigin({x: 10, y: 10}));
console.log(grid2.calculateDistanceFromOrigin({x: 10, y: 10}));



抽象类

抽象类作为其他派生类的基类使用，一般不会直接被实例化。不同于接口，抽象类可以包含成员的实现细节。abstract关键字用来定义抽象类和抽象类内部定义的抽象方法。abstract class Animal {
    abstract makeSound(): void;
    move(): void {
        console.log("roaming the earth...");
    }
}


抽象类中的抽象方法不包含具体实现并且必须在派生类中实现，抽象方法的语法与接口方法相似。两者都是定义方法签名饭不包含方法体。然而，抽象方法必须包含abstract关键字且可以包含访问修饰符。
abstract class Department {

    constructor(public name: string) {
    }

    printName(): void {
        console.log('Department name: ' + this.name);
    }

    abstract printMeeting(): void; // 必须在派生类中实现
}

class AccountingDepartment extends Department {

    constructor() {
        super('Accounting and Auditing'); // 在派生类的构造函数中必须调用 super()
    }

    printMeeting(): void {
        console.log('The Accounting Department meets each Monday at 10am.');
    }

    generateReports(): void {
        console.log('Generating accounting reports...');
    }
}

let department: Department; // 允许创建一个对抽象类型的引用
department = new Department(); // 错误: 不能创建一个抽象类的实例
department = new AccountingDepartment(); // 允许对一个抽象子类进行实例化和赋值
department.printName();
department.printMeeting();
department.generateReports(); // 错误: 方法在声明的抽象类中不存在



高级技巧

  类定义会创建：类的实例类型和一个构造函数。

构造函数

当你在TypeScript里声明了一个类的时候，实际上同时声明了很多东西。 首先就是类的实例的类型。
class Greeter {
    greeting: string;
    constructor(message: string) {
        this.greeting = message;
    }
    greet() {
        return "Hello, " + this.greeting;
    }
}

let greeter: Greeter;
greeter = new Greeter("world");
console.log(greeter.greet());

let greeterMaker: typeof Greeter = Greeter; // typeof Greeter 意为获取Greeter类的类型，而不是实例的类型
greeterMaker.standardGreeting = "Hey there!";



把类当作接口使用

因为类可以创建出类型，所以你能够在允许使用接口的地方使用类
class Point {
    x: number;
    y: number;
}

interface Point3d extends Point {
    z: number;
}

let point3d: Point3d = {x: 1, y: 2, z: 3};

TypeScript/function.html.body:
函数

  TypeScript函数可以创建有名字的函数和匿名函数。

函数类型
为函数定义类型
    function add(x:number,y:number):number {
        return x+y;
    }

    let myAdd = function(x:number,y:number):number {
        return x+y;
    }

书写完整函数类型
    // 函数类型包含两部分：参数类型和返回值类型。 当写出完整函数类型的时候，这两部分都是需要的。
    let myAdd:{x:number,y:number} => number =
        function(x:number,y:number):number { return x+y; }；
    // 我们以参数列表的形式写出参数类型，为每个参数指定一个名字和类型。 这个名字只是为了增加可读性。
    let myAdd: (baseValue: number, increment: number) => number =
        function(x: number, y: number): number { return x + y; };

推断类型

在赋值语句的一边指定了类型但是另一边没有类型的话，TypeScript编译器会自动识别出类型：
// myAdd has the full function type
let myAdd = function(x: number, y: number): number { return x + y; };

// The parameters `x` and `y` have the type number
let myAdd: (baseValue: number, increment: number) => number =
    function(x, y) { return x + y; };



可选参数和默认参数

TypeScript里的每个函数参数都是必须的
function buildName(firstName: string, lastName: string) {
    return firstName + " " + lastName;
}

let result1 = buildName("Bob");                  // error, 参数缺失
